import 'package:flutter/material.dart';
import 'package:frontend_mobile/main.dart';
import 'package:frontend_mobile/pages/order_history_page.dart';
import 'package:frontend_mobile/pages/profile_page.dart';
import 'dart:convert';
import 'dart:typed_data';

class CatalogueCard extends StatelessWidget {
  const CatalogueCard({super.key, required this.isLoggedIn});

  final bool isLoggedIn;

  Widget getImagenBase64(String imagen) {
    Uint8List _bytesImage = Base64Decoder().convert(imagen.split(',').last);

    return Image.memory(
      _bytesImage,
      gaplessPlayback: true,
      width: 70,
      height: 70,
      fit: BoxFit.fitWidth,
    );
  }

  @override
  Widget build(BuildContext context) {
    return InkWell(
      onTap: () {},
      child: Container(
        margin: EdgeInsets.only(top: 10),
        width: (MediaQuery.of(context).size.width - 32) / 2,
        height: (MediaQuery.of(context).size.width) / 2,
        decoration: BoxDecoration(
          boxShadow: [
            BoxShadow(
              color: Colors.orange.withOpacity(0.5),
              spreadRadius: 1,
              blurRadius: 7,
              offset: Offset(0, 3), // changes position of shadow
            ),
          ],
          borderRadius: BorderRadius.all(Radius.circular(30)),
          color: Colors.white,
        ),
        child: Padding(
          padding: const EdgeInsets.all(8.0),
          child: Column(
            crossAxisAlignment: CrossAxisAlignment.start,
            children: [
              ClipRect(
                child: Center(
                    child: getImagenBase64(
                        "")),
              ),
              SizedBox(
                height: 10,
              ),
              Text("Norwegian Wood"),
              Text("Rp200000"),
              SizedBox(height: 20),
              isLoggedIn
                  ? Row(
                      mainAxisAlignment: MainAxisAlignment.spaceEvenly,
                      children: [
                        SizedBox(
                          width: 90,
                          height: 35,
                          child: TextButton(
                            style: ButtonStyle(
                                shape: MaterialStateProperty.all(
                                    RoundedRectangleBorder(
                                        borderRadius: BorderRadius.circular(18),
                                        side: const BorderSide(
                                            color: Colors.black)))),
                            onPressed: () {
                              // Navigate to "Your Prize" page
                              Navigator.push(
                                  context,
                                  MaterialPageRoute(
                                      builder: (context) => ProfilePage()));
                            },
                            child: const Text(
                              "Add to Cart",
                              style:
                                  TextStyle(color: Colors.orange, fontSize: 12),
                            ),
                          ),
                        ),
                        SizedBox(
                          width: 75,
                          height: 35,
                          child: TextButton(
                            style: ButtonStyle(
                                backgroundColor:
                                    MaterialStateProperty.all(Colors.orange),
                                shape: MaterialStateProperty.all(
                                    RoundedRectangleBorder(
                                        borderRadius: BorderRadius.circular(18),
                                        side: const BorderSide(
                                            color: Colors.orange)))),
                            onPressed: () {
                              // Navigate to "Your Prize" page
                              Navigator.push(
                                  context,
                                  MaterialPageRoute(
                                      builder: (context) =>
                                          OrderHistoryPage()));
                            },
                            child: const Text(
                              "Order",
                              style:
                                  TextStyle(color: Colors.white, fontSize: 12),
                            ),
                          ),
                        ),
                      ],
                    )
                  : SizedBox()
            ],
          ),
        ),
      ),
    );
  }
}
